import{_ as t,r,o as l,c as k,b as a,d as n,f as s,e}from"./app.675f509a.js";const m="/assets/file_exe.f39b07c3.png",p="/assets/step3.c68d0c61.png",o="/assets/step4.e3799bf5.png",u="/assets/step5.b43bdff9.png",d="/assets/service.c87b572f.png",g="/assets/step_login.040c9dc8.png",h={},c=e('<h1 id="petunjuk-pemasangan-hawa-cems-online" tabindex="-1"><a class="header-anchor" href="#petunjuk-pemasangan-hawa-cems-online" aria-hidden="true">#</a> Petunjuk Pemasangan Hawa CEMS Online</h1><h2 id="persyaratan-sistem" tabindex="-1"><a class="header-anchor" href="#persyaratan-sistem" aria-hidden="true">#</a> Persyaratan Sistem</h2><p>Hawa CEMS Online merupakan aplikasi yang cukup ringan, setidaknya begitu kesan beberapa pengguna yang sebelumnya sudah menggunakan aplikasi DIS (Data Interfacing System) lainnya yang kemudian mencoba menggunakan Hawa dan pada akhirnya memutuskan untuk seterusnya menggunakan Hawa. Tetapi walaupun dikatakan &quot;cukup ringan&quot;, kami tetap menyarankan setidaknya Hawa di install pada komputer dengan spesifikasi minimal seperti berikut:</p><ol><li>Prosesor Intel core i7 generasi ke 8 atau lebih, dan akan lebih baik jika menggunakan prosesor IntelÂ® XeonÂ®</li><li>RAM yang digunakan minimum sebesar 8GB</li><li>Kapasitan penyimpanan minimum 500GB dan akan lebih baik jika menggunakan SSD</li><li>Memiliki minimal 2 port LAN (LAN card), 1 port untuk menyambungkan ke jaringan sumber data dan 1 lagi untuk menyambungkan ke internet</li><li>Menggunakan monitor dengan resolusi FHD (1920X1080 px)</li><li>Sistem operasi Windows 10 Profesional 64bit atau lebih baru. Sangat memungkinkan jika anda ingin menggunakan sistem operasi berbasis UNIX, tetapi sebaiknya dikonsultasikan terlebih dahulu kami agar mendapatkan support yang maksimal.</li><li>Microsoft office 2019 atau lebih baru. Ini digunakan untuk keperluan fitur report dan pengelolaan data internal perusahaan pengguna Hawa.</li></ol><p>Populasi komputer yang cukup banyak digunakan untuk menjalankan Hawa diantaranya adalah:</p><ol><li>DELL T40</li><li>DELL T30</li></ol>',6),b={href:"https://github.com/cems-online/docs/edit/main/docs/panduan-installasi/index.md",target:"_blank",rel:"noopener noreferrer"},y=e('<h2 id="persiapan-pemasangan" tabindex="-1"><a class="header-anchor" href="#persiapan-pemasangan" aria-hidden="true">#</a> Persiapan pemasangan</h2><p>Setelah mengetahui sistem yang dibutuhkan, sebelum memulai pemasangan aplikasi Hawa anda perlu menyiapkan beberapa hal, diantaranya adalah:</p><ol><li><p>Komputer yang akan digunakan untuk menjalankan aplikasi Hawa CEMS Online.</p></li><li><p>File installer Hawa CEMS Online.</p><p><img src="'+m+'" alt="An Image"></p></li><li><p>Listrik yang stabil, ini akan mendukung lancarnya proses pemasangan.</p></li><li><p>Sambungan internet yang stabil.</p></li><li><p>Kopi dan snack ğŸ˜ƒ</p></li></ol><h2 id="proses-pemasangan" tabindex="-1"><a class="header-anchor" href="#proses-pemasangan" aria-hidden="true">#</a> Proses pemasangan</h2><p>Setelah semua siap, lakukan proses pemasangan sesuai dengan langkah-langkah berikut:</p><ol><li>Copy file installer kedalam komputer yang akan dipasangi Hawa.</li><li>Jalankan file installer Hawa CEMS Online dengan cara klik 2 kali atau klik kanan kemudian Run as Administrator.</li><li>Jika muncul dialog <strong>User Account Control</strong> yang membutuhkan konfirmasi bahwa anda mengijinkan installer Hawa CEMS Online melakukan perubahan pada komputer anda, klik pada tombol <strong>YES</strong>.</li><li>Setelah installer jalan anda akan diminta menentukan lokasi dimana aplikasi Hawa akan di install, sebaiknya pilih partisi yang tidak digunakan bersamaan dengan partisi sistem operasi, ini akan membantu menyelamatkan data jika dimasa mendatang perlu dilakukan installasi ulang sistem operasi atau ada pembaruan sistem operasi.</li></ol><p><img src="'+p+'" alt="An Image"></p><ol start="6"><li>Setelah anda menentukan lokasi pemasangan Hawa, klik pada tombol next, dan intaller Hawa akan mengonfirmasi kepada anda tentang lokasi tersebut.</li></ol><p><img src="'+o+'" alt="An Image"></p><ol start="8"><li>Jika anda sudah yakin dengan lokasi pemasangan Hawa tersebut, klik pada tombol install, kemudian tunggu proses pemasangan sampai selesai yang ditandai dengan tampilan seperti berikut:</li></ol><p><img src="'+u+'" alt="An Image"></p><ol start="10"><li>Setelah pemasangan selesai, klik pada tombol Finish.</li></ol><h2 id="mencoba-hawa" tabindex="-1"><a class="header-anchor" href="#mencoba-hawa" aria-hidden="true">#</a> Mencoba Hawa</h2><p>Langkah berikutnya adalah mencoba mengakses Hawa untuk memastikan bahwa proses pemasangan telah berhasil dan Hawa berjalan dengan baik pada komputer anda.</p><ol><li>Pastikan service <strong>Hawa RT</strong> dan <strong>Hawa Historycal Data Server</strong> statusnya sudah <em>Running</em> dengan cara tekan tombol <strong>Window+R</strong> pada keyboard secara bersamaan, kemudian ketik <code>services.msc</code> kemudian klik OK. Pada jendela services, cari service dengan nama <strong>Hawa RT</strong> dan <strong>Hawa Historycal Data Server</strong>, jika status belum <em>Running</em> anda bisa menjalankannya secara manual dengan klik pada tombol start, atau klik kanan &gt; start.</li></ol><p><img src="'+d+'" alt="An Image"></p>',16),f={start:"3"},_={href:"http://localhost:3000",target:"_blank",rel:"noopener noreferrer"},w=e('<p><img src="'+g+'" alt="An Image"></p><ol start="5"><li>Selamat, anda telah berhasil memasang Hawa. Cukup sederhana bukan?</li></ol><h2 id="langkah-berikutnya" tabindex="-1"><a class="header-anchor" href="#langkah-berikutnya" aria-hidden="true">#</a> Langkah berikutnya</h2><p><em>Hawa sudah terpasang, lalu apa yang harus saya lakukan agar bisa mengirimkan data CEMS agar tampil di aplikasi SIMPEL?</em></p><p>Begitulah kira-kira pertanyaan yang cukup sering muncul.</p><p>Sebelum Hawa bisa mengirimkan data pengukuran dari peralatan CEMS anda, ada beberapa tahapan yang perlu dilakukan, diantaranya:</p><ol><li>Menambahkan file lisensi ke dalam komputer anda.</li><li>Menambahkan dan mengkonfigurasi device yang akan menjadi sumber data Hawa.</li><li>Menambahkan cerobong pada Hawa.</li><li>Menambahkan parameter pengukuran dan memastikan bahwa pembacaannya telah sesuai.</li><li>Menambahkan parameter normalisasi dan koreksi oksigen agar sesuai dengan standar yang telah ditetapkan dalam peraturan KLHK.</li><li>Membuat algoritma untuk menandakan kondisi sumber emisi sedang dalam kondisi beroperasi normal, tidak beroperasi, kalibrasi atau rusak.</li><li>Mendapatkan App_id dan App_Secret dari KLHK.</li><li>Memasukan App_id dan App_Secret pada Hawa.</li><li>Menentukan jadwal pengiriman data dan data apa saja yang harus dikirimkan.</li><li>Mendapatkan persetujuan dari KLHK untuk mengirimkan data secara kontinyu ke SISPEK.</li><li>Menunggu proses sinkronisasi dari sistem SISPEK dengan sistem SIMPEL.</li></ol>',7);function H(S,M){const i=r("ExternalLinkIcon");return l(),k("div",null,[c,a("blockquote",null,[a("p",null,[n("Note: Informasi merk komputer dan tipe ini sama sekali tidak ada unsur iklan atau promosi, informasi ini murni hanya untuk memberikan referensi kepada pengguna lain atau calon pengguna baru dengan harapan mempermudah penentuan spesifikasi teknis sehingga efisien dalam mempersiapkan device yang akan digunakan. Jika anda menggunakan merk dan tipe lain, tetapi anda merasa puas dengan performanya, anda bisa menginformasikan merk dan tipe komputer tersebut kepada kami agar kami tambahkan pada daftar di atas atau langsung "),a("a",b,[n("menambahkan sendiri"),s(i)]),n(" pada dokumen ini.")])]),y,a("ol",f,[a("li",null,[n("Setelah service berjalan, akses Hawa melalui browser seperti Google Chrome atau Mozilla Firefox atau Microsoft Edge. Buka tautan: "),a("a",_,[n("http://localhost:300"),s(i)]),n(". Jika muncul formulir untuk login, itu berarti Hawa sudah berjalan.")])]),w])}const x=t(h,[["render",H],["__file","index.html.vue"]]);export{x as default};
